import { createContext } from "react"
import LoginAppUserInfo from "./LoginAppUserInfo"
import LoginAppUserLogin from "./LoginAppUserLogin"

const UserContext = createContext();

const LoginApp = ()=>{
    return(
        <UserContext.Provider>
            <LoginAppUserInfo />
            <LoginAppUserLogin />
        </UserContext.Provider>
    )
}

export default LoginApp
